window.bookSummaryJSON = "<p><b>Who needs a Class when you're already the strongest anyways?</b></p> <p>Ten years ago, Amelia woke up alone and lost in a broken world where she had to fight for her survival.</p> <p>Now, after reaching the pinnacle of power, defeating the Void itself, and escaping the abyss, she has finally found her way back into the real world.</p> <p>But instead of returning to Earth, she arrives in the land of Vacuos. A fantasy world with magic, monsters, Classes, and Levels. A world that is governed by a System like it were a video game.</p> <p>When rewarded with a Class befitting her accomplishments—to become a powerful [Hero] that will forever dedicate her life to protecting this world that is not her own—she only has one response: “Absolutely not. I’m going to live a normal life now, thank you very much.”</p> <p>Check out this fun, action-packed LitRPG Isekai Adventure! It is one of the fastest-growing novels of all time on RoyalRoad with millions of views. Now available on Audible!</p>"; 
